INSERT INTO  `items_data` VALUES
(16214, 'weapon_vesper_pincer_i01.png', 'Vesper Pincer - Thunder {PvP} - Focus', NULL, 'Masterwork Item that increases P. Critical Rate. Kamael-exclusive Weapon: Vesper Cutter Conversion <br/><Special Option><br/>Increases Critical by 131. Increases damage inflicted during PvP. Has a chance of recovering CP during an attack.<br/>When enchanted to 4 or more, there is a chance that party members including yourself will get increased P. Atk., M. Atk., and the amount of received heal, and decreased MP consumption during skill use.<br/>No Soul Crystal option.', 'Клещи Венеры - Гром {PvP} - Фокусировка', NULL, 'Редкий предмет, увеличивающий шанс Крит. Атк., Эксклюзивное оружие Камаэль: Конверсия Резака Венеры</br><Особые свойства></br>Шанс Крит. Атк. +131. Наносит дополнительный урон в PvP. С некоторой вероятностью восстанавливает CP во время атаки. </br>При модификации на +4 и выше при Крит. Атк. дает шанс увеличить Физ. Атк., Маг. Атк., мощность лечения; уменьшает расход MP для умений Вам и членам Вашей группы.</br>Нельзя применить Кристалл Души.', 0, 0, 1, 's80', 'consume_type_normal'),
(16215, 'weapon_vesper_schutze_i01.png', 'Vesper Shooter - Clairvoyance {PvP} - Cheap Shot', NULL, 'Masterwork Item that increases range. Kamael-exclusive Weapon: Vesper Thrower Conversion<br/><Special Option><br/>MP consumption decreases by 12% during skill use. Increases damage inflicted during PvP. Has a chance of increasing Atk. Spd. of bows/crossbows during an attack.<br/>No Soul Crystal option.', 'Страж Венеры - Ясновидение {PvP} - Экономия', NULL, 'Редкий предмет, увеличивающий дальность атаки, Эксклюзивное оружие Камаэль: Конверсия Броска Венеры.</br><Особые свойства></br>Расход MP для умений -12%. Наносит дополнительный урон в PvP. С определенной вероятностью увеличивает Скор. Атк. из лука / арбалета.</br>Нельзя применить Кристалл Души.', 0, 0, 1, 's80', 'consume_type_normal'),
(16216, 'weapon_vesper_schutze_i01.png', 'Vesper Shooter - Clairvoyance {PvP} - Focus', NULL, 'Masterwork Item that increases range. Kamael-exclusive Weapon: Vesper Thrower Conversion<br/><Special Option><br/>Increases Critical by 133. Increases damage inflicted during PvP. Has a chance of increasing Atk. Spd. of bows/crossbows during an attack.<br/>No Soul Crystal option.', 'Страж Венеры - Ясновидение {PvP} - Фокусировка', NULL, 'Редкий предмет, увеличивающий дальность атаки, Эксклюзивное оружие Камаэль: Конверсия Броска Венеры.</br><Особые свойства></br>Шанс Крит. Атк. +133. Наносит дополнительный урон в PvP. С определенной вероятностью увеличивает Скор. Атк. из лука / арбалета.</br>Нельзя применить Кристалл Души.', 0, 0, 1, 's80', 'consume_type_normal'),
(16217, 'weapon_vesper_schutze_i01.png', 'Vesper Shooter - Clairvoyance {PvP} - Critical Slow', NULL, 'Masterwork Item that increases range. Kamael-exclusive Weapon: Vesper Thrower Conversion<br/><Special Option><br/>Casts Slow at a 24% rate during a Critical Attack. Increases damage inflicted during PvP. Has a chance of increasing Atk. Spd. of bows/crossbows during an attack.<br/>No Soul Crystal option.', 'Страж Венеры - Ясновидение {PvP} - Крит. Замедление', NULL, 'Редкий предмет, увеличивающий дальность атаки, Эксклюзивное оружие Камаэль: Конверсия Броска Венеры.</br><Особые свойства></br>Дает шанс 24% колдовства Замедления при Крит. Атк. Наносит дополнительный урон в PvP. С определенной вероятностью увеличивает Скор. Атк. из лука / арбалета.</br>Нельзя применить Кристалл Души.', 0, 0, 1, 's80', 'consume_type_normal'),
(16218, 'weapon_vesper_nagen_i01.png', 'Vesper Nagan - Great Gale {PvP} - Haste', NULL, 'Masterwork Item that increases Atk. Spd. Kamael-exclusive Weapon: Vesper Slasher Conversion<br/><Special Option><br/>Increases Atk. Spd. by about 11%. Increases damage inflicted during PvP. Has a chance of inflicting additional damage during an attack.<br/>No Soul Crystal option.', 'Оскал Венеры - Великая Буря {PvP} - Ускорение', NULL, 'Редкий предмет, увеличивающий Скор. Атк., Эксклюзивное оружие Камаэль: Конверсия Эспадона Венеры.</br><Особые свойства></br>Скор. Атк. +11%. Наносит дополнительный урон в PvP. При атаке дает шанс нанести дополнительный урон.</br>Нельзя применить Кристалл Души.', 0, 0, 1, 's80', 'consume_type_normal'),
(16219, 'weapon_vesper_nagen_i01.png', 'Vesper Nagan - Great Gale {PvP} - Health', NULL, 'Masterwork Item that increases Atk. Spd. Kamael-exclusive Weapon: Vesper Slasher Conversion<br/><Special Option><br/>Increases Max HP by 25%. Increases damage inflicted during PvP. Has a chance of inflicting additional damage during an attack.<br/>No Soul Crystal option.', 'Оскал Венеры - Великая Буря {PvP} - Здоровье', NULL, 'Редкий предмет, увеличивающий Скор. Атк., Эксклюзивное оружие Камаэль: Конверсия Эспадона Венеры.</br><Особые свойства></br>Макс. HP +9%. Наносит дополнительный урон в PvP. При атаке дает шанс нанести дополнительный урон.</br>Нельзя применить Кристалл Души.', 0, 0, 1, 's80', 'consume_type_normal'),
(16220, 'weapon_vesper_nagen_i01.png', 'Vesper Nagan - Great Gale {PvP} - Focus', NULL, 'Masterwork Item that increases Atk. Spd. Kamael-exclusive Weapon: Vesper Slasher Conversion<br/><Special Option><br/>Increases Critical by 131. Increases damage inflicted during PvP. Has a chance of inflicting additional damage during an attack.<br/>No Soul Crystal option.', 'Оскал Венеры - Великая Буря {PvP} - Фокусировка', NULL, 'Редкий предмет, увеличивающий Скор. Атк., Эксклюзивное оружие Камаэль: Конверсия Эспадона Венеры.</br><Особые свойства></br>Шанс Крит. Атк. +131. Наносит дополнительный урон в PvP. При атаке дает шанс нанести дополнительный урон.</br>Нельзя применить Кристалл Души.', 0, 0, 1, 's80', 'consume_type_normal'),
